import React from 'react'
import './Header.css'
import Logo from '../../assets/logo.png'
import Navbar from '../Navbar/Navbar'
function Header() {
  return (
    <div className='header'>
    <img src={Logo} className='logo'></img>    
    // <Navbar></Navbar>
    </div>
  )
}

export default Header
